Corresponded with help desk (David Obenshain). The organization field is not searchable from the API. He sent an example result searching by grant number. From the fields returned it doesn't look like there's anything that can help us here. I've asked for more details but unfortunately it looks like we're in a situation similar to OpenNeuro: unless we have a step where someone inputs a record id we won't be able to pull metadata from this repository. Even then it might not be entirely reliable, since there doesn't seem to be a way to limit the query to a specific field. The grant number would probably be the most reliable identifier, since their record id is just an integer.

Here's the info I received (there was a problem with the api via the swagger ui, which he refers to at the end):

```
You could try a request using cURL for example:
curl --location --request POST 'https://nda.nih.gov/api/search/nda_sw_removal/collection/full' \
--header 'Content-Type: text/plain' \
--data-raw 'Princeton'
This returns no search results, as organization is not one of the attributes we currently expose for search from within the search API. 

We do, however, support query by grant number, which will return the collection associated with this grant.
curl --location --request POST 'https://nda.nih.gov/api/search/nda_sw_removal/collection/full' \
--header 'Content-Type: text/plain' \
--data-raw 'R01MH112566'

